INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("ヤマト", 2.1, 3001100, 1, 0.0, -416.5, "2030/01/01 14:59:59", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 2, 130011, 100, "2024/10/31 12:00:00", 3001);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("ヤマト", 5.68, 3001101, 4, 0.0, -416.5, "2030/01/01 14:59:59", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 2, 130011, 101, "2024/10/31 12:00:00", 3001);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("ヤマト", 0.0, 3001102, 1, 0.0, -416.5, "2030/01/01 14:59:59", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 1, 130011, 102, "2024/10/31 12:00:00", 3001);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 0.0, 3002100, 1, 0.0, -416.5, "2030/01/01 14:59:59", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 1, 130211, 100, "2024/10/31 12:00:00", 3002);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 0.0, 3002101, 1, 0.0, -416.5, "2030/01/01 14:59:59", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 1, 130211, 101, "2024/10/31 12:00:00", 3002);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 8.53, 3002102, 5, 0.0, -416.5, "2030/01/01 14:59:59", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 2, 130211, 102, "2024/10/31 12:00:00", 3002);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 5.67, 3002103, 7, 0.0, -416.5, "2030/01/01 14:59:59", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 1, 130211, 103, "2024/10/31 12:00:00", 3002);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 0.0, 3002104, 1, 0.0, -416.5, "2030/01/01 14:59:59", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 1, 130211, 104, "2024/10/31 12:00:00", 3002);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 0.0, 3002300, 3, 0.0, -416.5, "2030/01/01 14:59:59", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3, 130211, 300, "2024/10/31 12:00:00", 3004);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 0.0, 3002400, 7, 0.0, -416.5, "2030/01/01 14:59:59", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 7, 130211, 301, "2024/10/31 12:00:00", 3005);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 4.4, 3003200, 2, 0.0, -416.5, "2030/01/01 14:59:59", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 1, 130211, 200, "2024/10/31 12:00:00", 3003);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 0.0, 3003201, 7, 0.0, -416.5, "2030/01/01 14:59:59", "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 7, 130211, 201, "2024/10/31 12:00:00", 3003);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES ("フブキ", 5.6, 3003202, 1, 0.0, -416.5, "2030/01/01 14:59:59", "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 2, 130211, 202, "2024/10/31 12:00:00", 3003);
